⠀
Unravelling and peeling back the onion layers, day after day. Moment after moment. ⠀
No, its not always glamorous. You can be certain that there are times that the over-analysing nature of my mind can be a wee-bit overwhelming to say the least. ⠀
But the most I’ve evolved and grown is when I’ve committed to bearing witness to the lessons in any given situation, and digging my heels in ~> using curiosity and self-compassion as my guide-posts.⠀
⠀
Can you learn what curiosity looks like in your life? Can you sense it? And feel it? ⠀
And lean-in to the way it curls around your experiences, and gathers up the debris for you to learn from?⠀

are you in the habit of allowing curiosity to take your fear by the hand, and lead it to a place of genuine care and kindness?⠀
⠀
What would happen if you chose today, if only for today, to replace all fearful thoughts, notions and ideas, with a curious and playful interaction ?⠀
