The older the soul, the deeper the cave. Many Starseeds and old souls enjoy their own company. Spending time alone can be comforting and necessary for their vitality, as it allows them to commune with their soul and fill up their energetic resources especially if they have an underactive or open root chakra or find it hard being human.
